    {
      Year: 2019,
      Number: 2361
    },
    {
      Year: 2020,
      Number: 2555
    },
    {
      Year: 2021,
      Number: 2802
    },
  ]

export default function MatriculantChartPage() {
  return (

    <div style={{width:"100%"}}>
      <div style={{height:"5vh"}}></div>
        <MatriculantChart data={data} />
    </div>
  )
}
